import './App.scss';
import HomePage from './components/homePage/HomePage';
import './fonts/Nimbus-Sans-D-OT-Ultra-Light_32757.ttf';
import { BrowserRouter, Route } from 'react-router-dom';
import AllRestaurants from './components/allRestaurants/AllRestaurants';
import AllChefs from './components/allChefs/AllChefs';
import PrivacyPolicy from './components/footer/PrivacyPolicy';
import TermsOfUse from './components/footer/TermsOfUse';
import ContactUs from './components/footer/ContactUs';

function App() {
  return (
    <BrowserRouter>
      <Route path="/Home" exact>
        <HomePage />
      </Route>
      <Route path="/" exact>
        <HomePage />
      </Route>
      <Route path="/AllRestaurants" exact>
        <AllRestaurants />
      </Route>
      <Route path="/AllChefs" exact>
        <AllChefs />
      </Route>
      <Route path="/PrivacyPolicy" exact>
        <PrivacyPolicy />
      </Route>
      <Route path="/TermsOfUse" exact>
        <TermsOfUse />
      </Route>
      <Route path="/AllChefs" exact>
        <AllChefs />
      </Route>
    </BrowserRouter>
  );
}

export default App;
